import * as React from 'react'
interface FormElements extends HTMLFormControlsCollection {
  fruitinput: HTMLInputElement
}
interface FruitFormElements extends HTMLFormElement {
  readonly elements: FormElements
}
function FruitForm({
  onSubmitFruit,
}: {
	onSubmitFruit: (username: string) => void
}) {
  function handleSubmit(event: React.FormEvent<FruitFormElements>) {
    event.preventDefault()
    onSubmitFruit(event.currentTarget.elements.fruitinput.value)
  }
  return (
    <form onSubmit={handleSubmit}>
      <div>
        <label htmlFor="fruitinput">Username:</label>
        <input id="fruitinput" type="text" />
      </div>
      <button type="submit">Submit</button>
    </form>
  )
}
